CREATE DEFINER=`root`@`localhost` PROCEDURE `info_client`(IN no_client INT, OUT age INT, OUT anciennete INT, OUT age_debut INT, OUT lib_anc VARCHAR(25),OUT lib_age VARCHAR(25))
BEGIN
select (year(curdate()) - year(birthdate)) INTO age from customer where customer_id = no_client;
select (year(curdate()) - year(date_accnt_opened)) INTO anciennete from customer where customer_id = no_client;
SET age_debut = age - anciennete;

IF anciennete < 11 THEN
	SET lib_anc = "RECENT";
ELSE
	SET lib_anc = "ANCIEN";
END IF;

CASE
	WHEN age < 30 THEN SET lib_age = "JEUNE";
	WHEN (age >= 30 AND age <= 60) THEN SET lib_age = "MEDIUM";
	WHEN age > 60 THEN SET lib_age = "VIEUX";
END CASE;
END ;;
