CREATE FUNCTION defineIfMemberIsProfessional()
	RETURNS VARCHAR(50) DETERMINISTIC
BEGIN
	DECLARE businessName VARCHAR(50);

    -- There's 1/3 chance to be a professional
    IF FLOOR(RAND()*(3)) > 1 THEN
